import React from 'react';
import Header from '../../components/Header';


const UserSalePage = () => {
    return (
        <>
               <div className="main-sales-content">
                    <Header />

                    <main>
                        <h2 className="dash-title">All Sale Out Product</h2>
                        <section className="recent-sales">
                            <div className="products-card">
                                    <h3>Recently Customer Order List</h3>
                            </div>
                        </section>
                    </main>
               </div>
        </>
    )
}

export default UserSalePage;
